import React from 'react';
import './TodoCounter.css';


function TodoCounter() {
    return (
        <>
        <h2>What's Up Today! </h2>
        <p> Has completado 2 de 3 TODO's</p>
        <input className="counter" placeholder="Cebolla" />

        </>
    );
}

export { TodoCounter } ;
